import React from "react";
import Header from "./js/components/Header";
import RecentImages from "./js/components/RecentImages";
import "./App.css";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Header />
        <RecentImages />
      </div>
    </BrowserRouter>
  );
}

export default App;
